      content: >2-

        [head=1]Ship Manual[/head]

        Privet tovarisch,


        This ship for shock combat, not for sustained fight. Has armory, medical bay, two 90mm cannon, one tarnyx, two torpedo launcher. Each launcher three torpedo. All you get. No extra torpedo, no printer. Do not waste.


        Tarnyx loaded with three EMP, three more on rack. Tactic simple: disable enemy with EMP. Then close, shoot 90mm. When near, torpedo. Then fly far, repeat. Ship fast, but turn slow. Has radar, gunner can prepare or alert.


        Main purpose  fleet medic, combat escort, or rescuing client.


        Behind you two smartgun pistolet. Good for cockpit staff. Make sure on burst fire. Recommend cockpit crew buy bounty hunter flak vest. Very good pierce protection. Hat good too, da.


        Armory have enough gun for crew four  maximum crew recommended. Two extra magazine for each gun, no ammo belt. Two armor vest, two hardsuit. In case breach, two suit in medical, two armory. Armory hardsuit more armored, are scaf, but medical is good too, is mercenary suit. Do not wear vest in space, die like idiot.


        PPU welcomes you, try not die.
